import React, {Component} from 'react';
//import logo from './logo.svg';
import './App.css';

class App extends Component{

  state = {
    nama : 'budi',
    sekolah : 'purwadhika',
    number : 0
  }

  render(){
    return (
      <div>
        <div> {this.state.nama} bersekolah di {this.state.sekolah} </div>
        <div> {this.state.number}</div>
      </div>

    )
  }
}

export default App;
